#main a { 
font-family: "Inter";
    font-weight: 400;
    font-size: 13.3px;
    text-rendering: geometricPrecision;
    color: black;
    border: 1px solid #ffffff00;
    border-radius: 7px;
    padding: 0 10px 1px 10px;
    margin-bottom: 4px;
    width: 100%;
}

#main a:hover{
    box-shadow: 0 8px 12px -6px #0037ff9e;
    border: 1px solid #0037ff61;
}
